  [],\n\t\"revision_timestamp\": \"2015-07-23T03:29:59.310084\",\n\t\"name\": \"kirwin-national-wildlife-refuge-annual-narrative-report-calendar-year-1999\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kirwin
  National Wildlife Refuge summarizes refuge activities during the 1999 calendar year.
  \ The report begins with a summary of the years highlights and climatic conditions.
  The report includes a planning section which discusses management plans, public
  participation, compliance with environmental mandates, and research and investigations.
  \ Refuge administration is outlined; information about personnel, youth programs,
  other manpower programs, volunteer programs, funding, safety, technical assistance
  and other is given.  Habitat management is also covered.  Subjects include general,
  wetlands, croplands, grasslands, other habitat, grazing, fire management, pest control,
  and Partners for Wildlife.  The wildlife section of the report discusses wildlife
  diversity, endangered andor threatened species, waterfowl, marsh and water birds,
  shorebirds, gulls, terns and allied species, raptors, and fisheries resources.  The
  public uses of the refuge described in this report include general, outdoor classrooms
  students, interpretive foot trails, interpretive exhibitsdemonstrations, other interpretive
  programs, hunting, fishing, other wildlife oriented recreation, camping, and law
  enforcement.  The equipment and facilities section of the report provides information
  about new construction, rehabilitation, major maintenance, equipment utilization
  and replacement, computer systems and energy conservation.  Items of interest are
  provided at the end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
